    data: |
      SELECT DISTINCT - col0 * + col2 + - - col0 + CAST ( NULL AS INTEGER ) + + col1 / col0 * col2 FROM tab1 (FORMAT parquet) WHERE ( NOT 26 IS NOT NULL );
  - name: tab1

outputs:
  - name: q66.out
    data: |
